import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';
import UserEntry from './components/UserEntery'

function App() {
  return (
    <BrowserRouter>
      <div>
        <Navbar />

        <div>
          <Routes>
            <Route path="/UserEntery" element={<UserEntry />} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
